import React from "react";
import ReactDOM from "react-dom/client";

const root = ReactDOM.createRoot(document.getElementById("root"));

function Card(props) {
  return (
    <>
      <h1>{props.name}</h1>
      <img src={props.img} />
      <p>{props.phone}</p>
      <p>{props.email}</p>
    </>
  );
}

function Card2(props) {
  return (
    <>
      <h1>{props.name}</h1>
    </>
  );
  <img src={props.img} />;
}
root.render(
  <>
    <Card
      name="Sushant Dahal"
      img="https://encrypted-tbn0.gstatic.com/images?q=tbn:ANd9GcS6Kia7fGemH9BIJDxfZlKWWHKPNrLtb0WqPg&usqp=CAU"
      phone="9819067819"
      email="sushandahal0@gmail.com"
    />
