      name="Sachin Dahal"
      img="https://encrypted-tbn0.gstatic.com/images?q=tbn:ANd9GcQKn_OW45LM0L7H8gNI1LEu_d0boxhfobz3eg&usqp=CAU"
      phone="9815309245"
      email="sachindahal0@gmail.com"
    />
  </>
);
